import './App.css'

function App(){
const users = [
  {name : 'Najad', age: 26},
  {name: 'Hanad', age: 24},
  {name: "Ahmed", age: 20}
]

return (
  <div className='App'>
    {users.map((user, key)=>{
      return (
        <h1 key={key}>user}</h1>
      )
    })}
  </div>
)
}

export default App
